import React from 'react'
import Container from 'react-bootstrap/Container'
const img = require("../pages/img/badminton.jpg");
const Home = () => (
    <div style={{ display: 'flex', justifyContent: 'center', margin: 82 }} >
        <div className="team" style={{ padding: 80 }}>
            <Container fluid>

            </Container>
        </div>
        <style JSX>{`
                .team {
                background: url('`+ img + `');
                height: 1000;

                }
                `}
        </style>
    </div>

)

export default Home;
